script: |
  super -f text -I q328.spq | sort > q328.out

inputs:
  - name: q328.spq
    data: |
      SELECT DISTINCT + + 53 + - + ( 0 ) * - 57 AS col2 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q328.out
    data: |
      53
